def entance(arr, target):
    left = 1
    right = len(arr) - 1
    first_occurrence = -1
    total_occurrences = 0
    while left <= right:
        mid = (left + right) // 2
        if arr[mid] == target:
            first_occurrence = mid
            total_occurrences += 1
            i = mid - 1
            while i >= 0 and arr[i] == target:
                total_occurrences += 1
                i -= 1
            i = mid + 1
            while i < len(arr) and arr[i] == target:
                total_occurrences += 1
                i += 1
            break
        elif arr[mid] < target:
            left = mid + 1
        else:
            right = mid - 1
    if first_occurrence != -1:
        return (first_occurrence, total_occurrences)
    else:
        return (-1, 0)

